Advisor_Analysis_1.query:
opp = load "${App.Datasets.FscDemoOpportunity.FullyQualifiedName}";
closed_won = filter opp by 'ISCLOSED' == "true" && 'ISWON' == "true";
exp_rev = filter opp by ('ISCLOSED' == "true" && 'ISWON' == "true") || ('ISCLOSED' == "false" && 'PROBABILITY' >= 90);
quota = load "${App.Datasets.FscDemoQuota.FullyQualifiedName}";
result = group closed_won by 'OPPORTUNITYOWNER' full, exp_rev by 'OPPORTUNITYOWNER' full, quota by 'USER';
result = foreach result generate coalesce(closed_won.'OPPORTUNITYOWNER', exp_rev.'OPPORTUNITYOWNER', quota.'USER') as 'OPPORTUNITYOWNER', sum(closed_won.'AMOUNT') as 'sum_Closed_Amount', sum(exp_rev.'EXPECTEDREVENUE') as 'sum_Expected_Revenue', sum(quota.'QUOTAAMOUNT') as 'sum_Quota_Amount', coalesce(first(closed_won.'OWNERSMALLPHOTOURL'), first(exp_rev.'OWNERSMALLPHOTOURL'), first(quota.'SMALLPHOTOURL')) as 'Owner.SmallPhotoUrl';
result_final = foreach result generate 'OPPORTUNITYOWNER', first('Owner.SmallPhotoUrl') as 'Owner.SmallPhotoUrl', {{cell(static_1.selection,0,"measure").asObject()}} as '{{cell(static_1.selection,0,"label").asObject()}}';
result_final = order result_final by ('{{cell(static_1.selection,0,"label").asObject()}}' desc);
result_final = limit result_final 2000;

Opportunity_Details_1.query:
q = load "${App.Datasets.FscDemoOpportunity.FullyQualifiedName}";
q = filter q by 'ISCLOSED' == "false";
q = group q by ID;
q = foreach q generate first('ACCOUNTNAME') as 'Account.Name', first('OPPORTUNITYAGE') as 'Opportunity Age', sum('AMOUNT') as 'Amount', first('CLOSEDATE') as 'CloseDate', first('ACCOUNTCLIENTCATEGORY') as 'Client Category', first('LEADSOURCE') as 'LeadSource', first('ACCOUNTMARKETINGSEGMENT') as 'Account Marketing Segment', first('OPPORTUNITYNAME') as 'Name',first('OPPORTUNITYOWNER') as 'Opportunity Owner', unique('ACTIVITYID') as '# of Activities', first('STAGE') as 'Stage';
q = limit q 100;

Activities_per_Oppty_by_Amount_Bucket.query:
q = load "${App.Datasets.FscDemoOpportunity.FullyQualifiedName}";
result = group q by ('OPPORTUNITYOWNER', 'ID');
result = foreach result generate q.'OPPORTUNITYOWNER' as 'OPPORTUNITYOWNER', q.'ID' as 'Id', count(q) as 'A', unique(q.'ACTIVITYID') as 'B', sum(q.'AMOUNT') as 'C';
result = group result by ('OPPORTUNITYOWNER', 'Id');
result = foreach result generate 'OPPORTUNITYOWNER', 'Id', sum(A) as 'A', sum(B) as 'B', sum(C) as 'C', avg(sum(C)) over ([..] partition by all) as 'D';
result = foreach result generate 'OPPORTUNITYOWNER', 'Id', sum(A) as 'A', sum(B) as 'B', sum(C) as 'C', case when 'C' >= 'D' then "1 - Top Half" else "2 - Bottom Half" end as 'Amount_Bucket';
result = group result by ('OPPORTUNITYOWNER', 'Amount_Bucket');
result = foreach result generate 'OPPORTUNITYOWNER', 'Amount_Bucket', sum(A) as 'count_Opportunities', sum(B) as 'count_Activities', sum(B) / sum(A) as 'count_Activities per Opportunity',  sum(C) as 'sum_Amount';
result = order result by ('OPPORTUNITYOWNER' asc, 'Amount_Bucket' asc);
result = limit result 2000;

Opportunity_KPIs_1.query:
q = load "${App.Datasets.FscDemoOpportunity.FullyQualifiedName}";
q_A = filter q by 'ISCLOSED' == "false";
q_B = filter q by 'ISCLOSED' == "true";
q_C = filter q by 'ISWON' == "true" && 'ISCLOSED' == "true";
q_D = filter q by 'ISCLOSED' == "true" && 'ISWON' == "false";
q_F = filter q by 'DAYSSINCELASTACTIVITY' >= 30 && 'ISCLOSED' == "false";
result = group q by all full, q_A by all full, q_B by all full, q_C by all full, q_D by all full, q_F by all;
result = foreach result generate count(q_A) as 'count_OpenDeals', count(q_B) as 'count_ClosedDeals', count(q_C) as 'count_ClosedWonDeals', count(q_D) as 'count_ClosedLostDeals', sum(q_A.'AMOUNT') as 'sum_OpenAmount', count(q_F) as 'count_NoActivitySince30Days', sum(q_C.'AMOUNT') as 'sum_ClosedWonAmount', sum(q_B.'AMOUNT') as 'sum_ClosedAmount', sum(q_D.'AMOUNT') as 'sum_ClosedLostAmount', unique(q.'OPPORTUNITYOWNER') as 'count_Advisors', sum(q_C.'OPPORTUNITYAGE') as 'sum_OpportunityAge', unique(q_C.'ACTIVITYID') as 'count_ClosedWonActivities';
result = foreach result generate 'count_OpenDeals' as 'count_Open Deals', 'count_ClosedDeals' as 'count_Closed Deals', 'count_ClosedWonDeals' as 'count_Closed Won Deals', 'count_ClosedLostDeals' as 'count_Closed Lost Deals', 'sum_OpenAmount' as 'sum_Open Amount', 'sum_ClosedAmount' as 'sum_Closed Amount', 'sum_ClosedWonAmount' as 'sum_Closed Won Amount', 'sum_ClosedLostAmount' as 'sum_Closed Lost Amount', 'count_NoActivitySince30Days' as 'count_No Activity Since 30 Days', 'count_Advisors', 'sum_OpportunityAge' as 'sum_Opportunity Age', 'count_ClosedWonActivities' as 'count_Closed Won Activities', ('sum_ClosedWonAmount'/'sum_ClosedAmount')*100 as 'Win Rate (%)', (('sum_ClosedWonAmount'/'sum_ClosedAmount') / 'count_Advisors')*100 as 'Win Rate (%) per Advisor', 'sum_ClosedWonAmount'/'count_Advisors' as 'avg_Closed Won Amount per Advisor', 'sum_OpportunityAge'/'count_ClosedWonDeals' as 'avg_Days To Close per Opportunity', 'count_ClosedWonDeals'/count_Advisors as 'avg_Closed Won Deals per Advisor', 'count_ClosedWonActivities'/('sum_ClosedWonAmount'/1000) as 'avg_Activities per 1k Closed';
result = limit result 1;

Quota_Attainment_KPIs_1.query:
