oppty = filter q by 'ISCLOSED' == "true" && 'ISWON' == "true";
exp_rev = filter q by ('ISCLOSED' == "true" && 'ISWON' == "true") || ('ISCLOSED' == "false" && 'PROBABILITY' >= 90);
quota = load "${App.Datasets.FscDemoQuota.FullyQualifiedName}";
result = group oppty by all full, exp_rev by all full, quota by all, q by all;
result = foreach result generate sum(oppty['AMOUNT']) as 'sum_Closed_Amount', sum(quota['QUOTAAMOUNT']) as 'sum_Quota_Amount', sum(exp_rev['AMOUNT']) as 'sum_Expected_Revenue', unique(q['OPPORTUNITYOWNER']) as 'count_Advisors' ;
result_final = foreach result generate 'sum_Closed_Amount' as 'sum_Closed Amount', 'sum_Quota_Amount' as 'sum_Quota Amount', 'sum_Expected_Revenue' as 'sum_Expected Revenue', 'count_Advisors', round('sum_Closed_Amount' / 'sum_Quota_Amount' * 100, 2) as 'sum_Quota Attainment', 'sum_Expected_Revenue' - 'sum_Quota_Amount' as 'sum_Expected Revenue Diff from Quota', round((('sum_Closed_Amount' / 'sum_Quota_Amount' / 'count_Advisors') * 100), 2) as 'sum_Quota Attainment per Advisor';
